✨HEALING ESSENTIALS GIVEAWAY✨
It’s time to celebrate the healing powers of plants and fungi. We’re excited to partner with some incredible allies for a giveaway that will leave your mind, body, and soul feeling expanded and nourished. The prizes include over $1000 worth of educational materials + plant and fungi focused products. The giveaway closes on August 30 — enter via the link in our bio and follow the prompts for bonus entries!

Prizes include:
@doubleblindmag — Psychedelic Essentials Bundle (How to Microdose with @flowstatemicro + How to Use Psychedelics Courses)
@drinkmudwtr — Starter Kit
@jungmaven — $300 Gift card
@fungiacadmey — Sacred Mushroom Cultivation Course + Psychedelic Journeywork Course
@missgrass — MG Essentials: Hemp + Herb Minis Trio, “Good at Weed” Lighter Case + Grass + Flower Stash Jar
@yawntogether — The Mush-Stash Bag: a storage bag for mushrooms
@northsporemushrooms — Lion’s Mane Grow Kit

*This giveaway is limited to participants 21+. The giveaway closes at 11:59 pm PST on August 30. One winner will be selected at random and contacted via email. This giveaway is not sponsored by or affiliated with Instagram or Facebook.
